自動車及び家庭用 窓ガラス・ガラス製ミラーの洗浄<br>
<br>
●界面活性剤や着色料を含まないので、拭きスジが一切残りません。<br>
●強力な洗浄成分が、油膜、ヤニ、泥汚れ、鳥のフン、虫の死骸、樹液などの頑固な汚れをすばやく取り除きます。<br>
●着色フィルムや断熱・UVカットフィルムなどが貼られたガラスにも使用できます。<br>
●成分:水性洗浄剤、アルコール類、水<br>
●液性:弱酸性<br>
●内容量:651ml<br>
