ディープクリーンジェルが密着&洗浄する新感覚のホイールクリーナー<br>
<br>
●密着性・浸透力・洗浄力にすぐれたディープクリーンジェルが、ブレーキダスト、ロードダスト、グリース、オイル、泥などの頑固な汚れを分解・除去します。<br>
●鉄、アルミニウム合金、メッキ、ファクトリー塗装など、様々なホイールやホイールキャップに使用できます。<br>
●ホイールに影響を与える化学反応を起こしません。<br>
●タイヤにも使用できます。<br>
